INSERT INTO obra  (nombre, idProyecto, tipoUbicacion, direccion, usig_latitud, usig_longitud, idSubtipoObra, idSubTipoObraAux, referenteEjecucion, informacionRelevamiento, estado, prioridadJefatura, fechaInicio, fechaFin) VALUES ('VILLA 1-11-14 - Cancha de los Paraguayos',(SELECT DISTINCT p.idProyecto FROM hito_proyecto h INNER JOIN proyecto p ON h.idProyecto = p.idProyecto INNER JOIN objetivo_operativo o on p.idObjetivoOperativo = o.idObjetivoOperativo INNER JOIN objetivo_jurisdiccional j ON o.idObjetivoJurisdiccional = j.idObjetivoJurisdiccional INNER JOIN jurisdiccion ju ON j.idJurisdiccion = ju.idJurisdiccion WHERE h.nombre ='Obras UTIU Comuna 7 (1-11-14) FF. Cancha de los Paraguayos' AND ju.nombre = 'Ministerio de Desarrollo Humano y Habitat'),'direccion','0.00 y 0.00',null,null,(SELECT s.idSubtipoObra FROM subtipo_obra s, tipo_obra t WHERE s.idTipoObra = t.idTipoObra AND s.nombre = 'Plazas y plazoletas' AND t.nombre = 'Espacio público'),(SELECT s.idSubtipoObra FROM subtipo_obra s, tipo_obra t WHERE s.idTipoObra = t.idTipoObra AND s.nombre = 'Plazas y plazoletas' AND t.nombre = 'Espacio público'),'0.00','La obra tiene por objetivo poder realizar la recuperación del espacio público de la Manzana 15 correspondiente a la Cancha de los Paraguayos promoviendo actividades deportivas e inclusivas. Asimismo  se planea mejorar la infraestructura de desagües pluviales en dicho sector. Se realizarán las siguientes tareas: Realización de solados:  -Colocación de solado intertrabado en frentes de vivienda -Realización de piso de hormigón armado H21 en cancha y calle existente. Sobre la cancha se realizará la pintura del piso. -Se delimitará la cancha multifunción preparada para realizar actividades de vóley, básquet y futbol Realización de rejas: -Las rejas se colocarán por detrás de los arcos y serán de un total de 12x4m de superficie. Cada reja estará conformada con perfiles de hierro amurados al suelo y soldados a paños de reja compuesta por un bastidor de perfil ángulo Tendido de infraestructura: Se realizará un tendido de red pluvial para favorecer los desagües de los frentes de viviendas y de la cancha propiamente dicha. Dicho sistema tiene salida a calzada por la calle Oceanía -Se realizarán canteros y sectores de descanso que favorezcan las actividades de esparcimiento -Paisajismo en el sector propiciando áreas verdes -Reductores de velocidad en acceso a cancha','Aprobado',null,null,'2017-09-30');
INSERT INTO hito_obra  (nombre, idObra, fechaInicio, fechaFin, estado) VALUES ('AnteProyecto',(SELECT idObra from obra WHERE nombre = 'VILLA 1-11-14 - Cancha de los Paraguayos' AND idProyecto = (SELECT DISTINCT p.idProyecto FROM hito_proyecto h INNER JOIN proyecto p ON h.idProyecto = p.idProyecto INNER JOIN objetivo_operativo o on p.idObjetivoOperativo = o.idObjetivoOperativo INNER JOIN objetivo_jurisdiccional j ON o.idObjetivoJurisdiccional = j.idObjetivoJurisdiccional INNER JOIN jurisdiccion ju ON j.idJurisdiccion = ju.idJurisdiccion WHERE h.nombre ='Obras UTIU Comuna 7 (1-11-14) FF. Cancha de los Paraguayos' AND ju.nombre = 'Ministerio de Desarrollo Humano y Habitat')),null,null,'No iniciado');
