INSERT INTO obra  (nombre, idProyecto, tipoUbicacion, direccion, usig_latitud, usig_longitud, idSubtipoObra, idSubTipoObraAux, referenteEjecucion, informacionRelevamiento, estado, prioridadJefatura, fechaInicio, fechaFin) VALUES ('VILLA 1-11-14 - Eje Riestra- PM/ Agustin de Vedia',(SELECT DISTINCT p.idProyecto FROM hito_proyecto h INNER JOIN proyecto p ON h.idProyecto = p.idProyecto INNER JOIN objetivo_operativo o on p.idObjetivoOperativo = o.idObjetivoOperativo INNER JOIN objetivo_jurisdiccional j ON o.idObjetivoJurisdiccional = j.idObjetivoJurisdiccional INNER JOIN jurisdiccion ju ON j.idJurisdiccion = ju.idJurisdiccion WHERE h.nombre ='Obras UTIU Comuna 7 (1-11-14) FF. Eje Riestra- PM/ Agustin de Vedia' AND ju.nombre = 'Ministerio de Desarrollo Humano y Habitat'),'direccion','0.00 y 0.00',null,null,(SELECT s.idSubtipoObra FROM subtipo_obra s, tipo_obra t WHERE s.idTipoObra = t.idTipoObra AND s.nombre = '0.00' AND t.nombre = '0.00'),(SELECT s.idSubtipoObra FROM subtipo_obra s, tipo_obra t WHERE s.idTipoObra = t.idTipoObra AND s.nombre = '0.00' AND t.nombre = '0.00'),'0.00','?	Eje Riestra - PM / Agustín de Vedia La avenida Riestra es una arteria principal de la Villa 1-11-14. Es un eje conector de importancia a la escala del barrio ya que conecta diferentes sectores del mismo. Es donde se encuentran ubicadas numerosas organizaciones, escuela, complejos habitacionales y espacios públicos relevantes. Se intervendrá en el sector que va desde la calle Agustín de Vedia hasta la Avenida Perito Moreno dando continuidad a la intervención que hizo la Comuna 7 en el tramo hacia el norte.  En la actualidad, este eje, se encuentra en mal estado de calles y veredas, tiene problemas de limpieza e inseguridad. Por todo lo expresado, la propuesta del proyecto consiste en: - Infraestructura pluvial. - Reparaciones del alumbrado público existente y colocación de nuevos artefactos. - Ordenamiento de Espacio Público: - Espacio para estacionamiento. - Espacios para áreas verdes que delimiten funciones. - Espacio para mobiliario urbano. - Realización y reacondicionamiento de calle y veredas.','Aprobado',null,null,'2017-10-31');
