INSERT INTO obra  (nombre, idProyecto, tipoUbicacion, direccion, usig_latitud, usig_longitud, idSubtipoObra, idSubTipoObraAux, referenteEjecucion, informacionRelevamiento, estado, prioridadJefatura, fechaInicio, fechaFin) VALUES ('VILLA 1-11-14 - Eje Varela (Aliviador)',(SELECT DISTINCT p.idProyecto FROM hito_proyecto h INNER JOIN proyecto p ON h.idProyecto = p.idProyecto INNER JOIN objetivo_operativo o on p.idObjetivoOperativo = o.idObjetivoOperativo INNER JOIN objetivo_jurisdiccional j ON o.idObjetivoJurisdiccional = j.idObjetivoJurisdiccional INNER JOIN jurisdiccion ju ON j.idJurisdiccion = ju.idJurisdiccion WHERE h.nombre ='Obras UTIU Comuna 7 (1-11-14) FF. Eje Varela (Aliviador)' AND ju.nombre = 'Ministerio de Desarrollo Humano y Habitat'),'direccion','0.00 y 0.00',null,null,(SELECT s.idSubtipoObra FROM subtipo_obra s, tipo_obra t WHERE s.idTipoObra = t.idTipoObra AND s.nombre = '0.00' AND t.nombre = '0.00'),(SELECT s.idSubtipoObra FROM subtipo_obra s, tipo_obra t WHERE s.idTipoObra = t.idTipoObra AND s.nombre = '0.00' AND t.nombre = '0.00'),'0.00','Este proyecto pretende realizar una mejora respecto a las condiciones actuales que presenta el sector en cuestión. Por un lado se realizará la mejora del espacio público favoreciendo la circulación tanto peatonal como vehicular de los flujos ya establecidos. Además se incorporará la realización de un nuevo tendido de red pluvial y cloacal favoreciendo a los vecinos (en una primer medida) frentistas de las manzanas 13, 14 y 15 de la villa 1-11-14 linderos a la calle Varela. Tareas a realizar en el sector (300 metros lineales): -Realización de tendido cloacal desde el pasillo San Juan hasta Au Perito Moreno dividido en dos sectores que desaguan a una misma boca de registro ubicada en la intersección de las calles Varela y pasaje San Jorge -Realización de tendido pluvial con desagüe a calzada desde acceso a viviendas -Consolidación de sector de estacionamiento a través de dársenas sobre veredas a ambos lados de calle Varela. Del sector correspondiente a las viviendas se estacionará a 90° y del correspondiente a Aysa a 45° -Consolidación de canteros a los lados de la calle Varela (según plano) -Realización de solados: Sector de piso existente y reparación de frente de viviendas. Consolidación de piso granítico pulido en zona de circulación de vereda. Realización de cemento peinado en sector estacionamiento -Realización de pavimento en sectores de demolición destinados a la realización de la red cloacal -Consolidación de cordón de vereda como delimitación entre el espacio vehicular (estacionamientos) y la circulación peatonal -Intervención de paisajismo en el sector en los espacios consolidados como canteros que dan a la calle Varela','Aprobado',null,null,'2017-06-30');
