INSERT INTO obra  (nombre, idProyecto, tipoUbicacion, direccion, usig_latitud, usig_longitud, idSubtipoObra, idSubTipoObraAux, referenteEjecucion, informacionRelevamiento, estado, prioridadJefatura, fechaInicio, fechaFin) VALUES ('CILDAÑEZ - Eje White',(SELECT DISTINCT p.idProyecto FROM hito_proyecto h INNER JOIN proyecto p ON h.idProyecto = p.idProyecto INNER JOIN objetivo_operativo o on p.idObjetivoOperativo = o.idObjetivoOperativo INNER JOIN objetivo_jurisdiccional j ON o.idObjetivoJurisdiccional = j.idObjetivoJurisdiccional INNER JOIN jurisdiccion ju ON j.idJurisdiccion = ju.idJurisdiccion WHERE h.nombre ='Obras UTIU Comuna 8 y 9 Este (Cildáñez) FF. Eje White' AND ju.nombre = 'Ministerio de Desarrollo Humano y Habitat'),'direccion','WHITE y CASCO, HORACIO, DR.',null,null,(SELECT s.idSubtipoObra FROM subtipo_obra s, tipo_obra t WHERE s.idTipoObra = t.idTipoObra AND s.nombre = 'Otros' AND t.nombre = 'Edificación'),(SELECT s.idSubtipoObra FROM subtipo_obra s, tipo_obra t WHERE s.idTipoObra = t.idTipoObra AND s.nombre = 'Otros' AND t.nombre = 'Edificación'),'0.00','La calle White actualmente se caracteriza por tener sectores de veredas en mal estado y sectores de veredas  ocupados por  viviendas, el acopio de material reciclable y chatarra en algunos puntos y la pobre iluminación. También se presentan  problemas en la infraestructura. Estos motivos impulsaron la siguiente propuesta que consiste en:  ?Ordenamiento del Espacio Público. ?Establecer espacios fijos para contenedores de basura. ?Delimitar los lugares para chatarrerismo. ?Espacio de estacionamiento para autos. ?Ensanchamiento de veredas ganando espacio para áreas verdes y delimitando el estacionamiento de autos. ?Áreas verdes con mobiliario. ?Creación de calles de convivencia. ?Iluminación a nivel peatonal y emprolijado de la red eléctrica existente mediante la reubicación de postes de tendido. ?Mejoramiento de los solados de las veredas sobre calle White y sobre pasillos que desembocan la misma, unificando niveles para mejorar la accesibilidad, la circulación peatonal y adecuadas pendientes para evitar inundaciones y pozos de agua. ?RED PLUVIAL reparación y adecuación de la red pluvial en existente (construcción de cámaras, conexiones, rejillas).','Aprobado',null,null,'2017-10-31');
INSERT INTO hito_obra  (nombre, idObra, fechaInicio, fechaFin, estado) VALUES ('AnteProyecto',(SELECT idObra from obra WHERE nombre = 'CILDAÑEZ - Eje White' AND idProyecto = (SELECT DISTINCT p.idProyecto FROM hito_proyecto h INNER JOIN proyecto p ON h.idProyecto = p.idProyecto INNER JOIN objetivo_operativo o on p.idObjetivoOperativo = o.idObjetivoOperativo INNER JOIN objetivo_jurisdiccional j ON o.idObjetivoJurisdiccional = j.idObjetivoJurisdiccional INNER JOIN jurisdiccion ju ON j.idJurisdiccion = ju.idJurisdiccion WHERE h.nombre ='Obras UTIU Comuna 8 y 9 Este (Cildáñez) FF. Eje White' AND ju.nombre = 'Ministerio de Desarrollo Humano y Habitat')),null,null,'No iniciado');
