prolijado de la red eléctrica existente mediante la reubicación de postes de tendido. ?Mejoramiento de los solados de las veredas sobre calle Zuviría y sobre pasillos que desembocan la misma, unificando niveles para mejorar la accesibilidad y la circulación peatonal, y adecuadas pendientes para evitar inundaciones y pozos de agua. ?RED PLUVIAL nueva, con rejillas para recibir el agua de lluvia y sus respectivas cámaras de inspección.','Aprobado',null,null,'2017-12-31');
