- Reparaciones del alumbrado público existente y colocación de nuevos artefactos. - Ordenamiento de Espacio Público: - Espacio para estacionamiento. - Espacios para áreas verdes que delimiten funciones. - Espacio para mobiliario urbano. - Realización y reacondicionamiento de calle y veredas. - Puesta en valor de la Plaza Minnie y Mickey. 	- Instalación de juegos infantiles. 	- Colocación de piso de goma.  	- Reparación de la canchita de fútbol existente.','Aprobado',null,null,'2017-06-30');
