INSERT INTO obra  (nombre, idProyecto, tipoUbicacion, direccion, usig_latitud, usig_longitud, idSubtipoObra, idSubTipoObraAux, referenteEjecucion, informacionRelevamiento, estado, prioridadJefatura, fechaInicio, fechaFin) VALUES ('VILLA 15 - Entorno Elefante Eje de la Rosa/Hubac',(SELECT DISTINCT p.idProyecto FROM hito_proyecto h INNER JOIN proyecto p ON h.idProyecto = p.idProyecto INNER JOIN objetivo_operativo o on p.idObjetivoOperativo = o.idObjetivoOperativo INNER JOIN objetivo_jurisdiccional j ON o.idObjetivoJurisdiccional = j.idObjetivoJurisdiccional INNER JOIN jurisdiccion ju ON j.idJurisdiccion = ju.idJurisdiccion WHERE h.nombre ='Obras UTIU Comuna 8 y 9 Oeste (Villa 15) FF. Entorno Elefante Eje de la Rosa/Hubac' AND ju.nombre = 'Ministerio de Desarrollo Humano y Habitat'),'direccion','0.00 y 0.00',null,null,(SELECT s.idSubtipoObra FROM subtipo_obra s, tipo_obra t WHERE s.idTipoObra = t.idTipoObra AND s.nombre = 'Otros' AND t.nombre = 'Edificación'),(SELECT s.idSubtipoObra FROM subtipo_obra s, tipo_obra t WHERE s.idTipoObra = t.idTipoObra AND s.nombre = 'Otros' AND t.nombre = 'Edificación'),'0.00','Los ejes que comprenden el "Entorno del Elefante Blanco? son calles que conectan internamente un gran sector de Ciudad Oculta. Sobre los mismos se encuentran algunos espacios públicos relevantes y unos nuevos a crear. En la actualidad, estos ejes, se encuentran en mal estado de calles y veredas, tiene problemas de limpieza, inseguridad, violencia y de infraestructura de cloacas, agua, pluvial y alumbrado público.  El proyecto consiste en: -Infraestructura cloacal -Infraestructura pluvial -Infraestructura de agua -Reparaciones del alumbrado público existente y colocación de nuevos artefactos -Ordenamiento de Espacio Público: -Espacio para estacionamiento -Espacios para áreas verdes que delimiten funciones -Espacio para mobiliario urbano -Realización y reacondicionamiento de calle y veredas','Aprobado',null,null,'2018-01-31');
