INSERT INTO obra  (nombre, idProyecto, tipoUbicacion, direccion, usig_latitud, usig_longitud, idSubtipoObra, idSubTipoObraAux, referenteEjecucion, informacionRelevamiento, estado, prioridadJefatura, fechaInicio, fechaFin) VALUES ('Parque "Roca" Cubierta Estadio "Mary Terán de Weiss"',(SELECT DISTINCT p.idProyecto FROM hito_proyecto h INNER JOIN proyecto p ON h.idProyecto = p.idProyecto INNER JOIN objetivo_operativo o on p.idObjetivoOperativo = o.idObjetivoOperativo INNER JOIN objetivo_jurisdiccional j ON o.idObjetivoJurisdiccional = j.idObjetivoJurisdiccional INNER JOIN jurisdiccion ju ON j.idJurisdiccion = ju.idJurisdiccion WHERE h.nombre ='Cubierta Arena Parque Roca' AND ju.nombre = 'Ministerio de Desarrollo Urbano y Transporte'),'direccion','ROCA, CNEL. AV. y 0.00',null,null,(SELECT s.idSubtipoObra FROM subtipo_obra s, tipo_obra t WHERE s.idTipoObra = t.idTipoObra AND s.nombre = 'Estadios' AND t.nombre = 'Edificación'),(SELECT s.idSubtipoObra FROM subtipo_obra s, tipo_obra t WHERE s.idTipoObra = t.idTipoObra AND s.nombre = 'Estadios' AND t.nombre = 'Edificación'),'TEJERINA, Carlos','El estadio Mary Terán de Weiss -donde la Argentina juega sus partidos de Copa Davis- quedará con una capacidad para 14.000 personas sentadas. La futura cubierta techará la superficie del predio para eventos deportivos y musicales, de aproximadamente 13.000 m2, y posibilitará, además, la apertura y el cierre de su zona central. Se montarán dos grandes guías por las que correrá el techo retráctil, que se utilizará según las necesidades. Su estructura será capaz de soportar las cargas provenientes de instalaciones suspendidas de equipos para eventos musicales o de otra índole y contará con un sistema conveniente de aislación térmica y acústica. A los costados del estadio se añadirán instalaciones complementarias: vestuarios, baños y salas de conferencias.','Aprobado',null,null,'2017-04-28');
